B.Ib=new A.rm("Questo\n\xe8 un percorso di scrittura,\nche si presenta\ncome l\u2019esplorazione di un\u2019<b>Isola<b>.\n\nUn viaggio,\nnove tappe,\ntrenta esercizi.\n\nOgni esercizio\n\xe8 articolato in tre fasi,\nche io chiamo\n<b>scrittura libera,<b>\n<b>honoo<b> (\"on\xf9\")\ne\n<b>hinoo<b> (\u201cin\xf9\u201d).\n\n\n<b>Scrittura libera<b>\nA partire dal tema proposto,\nscrivi per\n almeno dieci minuti,\nnella forma che preferisci.\n\nDedica cio\xe8\nuno spazio quotidiano\nalla scrittura,\ne difendilo.\n\nIn questa fase\npuoi accompagnare\nla scrittura\nad altri metodi\ndi rappresentazione,\ncome la fotografia\no il disegno.\n\nIn effetti\nsarebbe pi\xf9 esatto dire:\n\u201ca partire dal tema proposto,\ninizia una riflessione,\nannotando quello che affiora\nnel modo\nche ti sembra pi\xf9 comodo\u201d.\n\nSecondo me,\nun ottimo risultato\nsarebbe riuscire a \ndedicare a questa fase\nalmeno\nquaranta, cinquanta minuti\nal giorno.\nMa non considerare questo\nil tuo obiettivo.\n\nIl tuo obiettivo\n\xe8 quello di confrontarti\ncon questa prima fase\ntutti i giorni,\nsenza saltare alcun giorno.\n\nAvrai bisogno\ndi un orologio:\nsegna l\u2019orario in cui inizi\nla tua <b>scrittura libera<b>\ne continua\nfinch\xe9 non saranno trascorsi\n<b>almeno dieci minuti<b>.\n\nQuando smetti,\nscrivi l\u2019orario in cui hai smesso,\ne calcola\nquanto \xe8 durata la tua scrittura.\n\nLavora\ncon il massimo della\nconcentrazione,\ndopo aver cercato di eliminare\ntutte le possibili\nfonti di distrazione.\n\nIo scriverei al mattino,\ncon un pennarello molto fluido,\nsu fogli bianchi,\nsenza righe.\n\nSi tratta di gusti:\nti invito a scoprire i tuoi.\n\nTi consiglio\ndi non mostrare a nessuno\nquello che verr\xe0 fuori\nin questa prima fase di scrittura.\n\n\n<b>honoo<b>\nRileggi con attenzione\ntutto quello\nche\nsei riuscito a far affiorare\ndurante la <b>scrittura libera<b>,\ne poi,\na partire da quello che hai scritto,\nrealizza almeno un <b>honoo<b>.\n\nUn <b>honoo<b>\n\xe8 una composizione\narticolata in un <b>breve testo<b>,\ndisposto in un massimo di <b>cinque righe<b>,\ne un\u2019<b>immagine quadrata<b>.\n\nOgni riga contiene al massimo\ncirca trentadue caratteri.\n\nPer darti un'idea,\nquesta\n\xe8 la riga pi\xf9 lunga possibile.\n\n\u2014 Hai il presente. Non ti basta?\n\n\nIl testo\n\xe8 <b>formattato al centro<b>\ne\nscritto in <b>carattere Arvo<b>.\n\nIn questo contesto,\nconsidero l\u2019<b>honoo<b>\nuna tecnica\nper evidenziare\npunti caldi\ndal magma informe\ndella <b>scrittura libera<b>,\ne per iniziare\na strutturare\nquesti punti caldi\nin forme pi\xf9 complesse.\n\n\n<b>hinoo<b>\nDopo aver realizzato\nalmeno un <b>honoo<b>,\nscrivi\nalmeno un <b>hinoo<b>.\n\nCol termine <b>hinoo<b>.\n\nUn<b>hinoo<b>\n\xe8 una composizione\nformata\nda un <b>testo<b>,\ndisposto in un massimo\ndi <b>ventuno righe,\nsopra un'<b>immagine rettangolare<b>.\n\n\nLe dimensioni dell'immagine sono\n<b>1080<b> pixel in larghezza\ne <b>1920<b> in altezza,\ncon un rapporto d'aspetto <b>9:16<b>\ndcome una Storia Instagram.\n\nLa lunghezza massima\ndi ogni riga\n\xe8 come quella\ndella riga di un honoo.\n\nIl carattere \xe8 <b>Lora<b>\n\nIl <b>colore<b> del testo\npu\xf2 essere\n<b>bianco<b> o <b>nero<b>.\n\nNelle mie intenzioni,\nla scelta espressiva\ndel punto\n in cui andare\n \"a capo\",\nnei testi dell\u2019<b>honoo<b>\ne dell\u2019<b>hinoo<b>,\naccende\nun riflettore\nsu alcuni elementi,\ne ci indica\nla strada\nverso\nla nostra storia.\n\nL\u2019ideale\nsarebbe svolgere\nnell\u2019arco della stessa giornata.\nle tre fasi\ndi ogni esercizio:\n<b>scrittura libera<b>,\n<b>honoo<b>\ne\n<b>hinoo<b>.\n\nSe vuoi comporre\ni tuoi <b>honoo<b>\ne i tuoi <b>hinoo<b>,\nclicca sulla <b>Bottiglia<b>.\n\nSe vuoi vedere\ngli <b>honoo<b>\ne gli <b>hinoo<b>\ndegli altri,\nclicca sulla <b>Luna<b>.\n\nSe clicchi sullo <b>Scrigno<b>,\npuoi vedere\ngli <b>honoo<b> e gli <b>hinoo<b>\nche hai scritto,\ngli <b>honoo<b> e gli <b>hinoo<b>\nche hai salvato,\ne gli <b>honoo<b> e gli <b>hinoo<b>\nche hai ricevuto in risposta\nai tuoi <b>honoo<b> e <b>hinoo<b>.\n\nSe vuoi iniziare\nil tuo viaggio sull\u2019<b>Isola<b>,\nclicca su <b>1<b>\ne vai alla\n<b>Grotta delle Rondini<b>.\n\nSe sei iscritto al mio Corso,\nogni settimana ti assegner\xf2\nun esercizio,\nda svolgere nelle tre fasi,\n<b>scrittura libera<b>,\n<b>honoo<b>\ne<b>hinoo<b>,\ne ogni marted\xec,\nentro le 18.00,\ndovrai caricare\nalmeno un honoo\no un hinoo\nnella cartella\n<b>Marted\xec, entro le 18.00<b>\ncondivisa con te su Google Drive,\n\ncon privilegi da Editor.\n\nDopo le 18.00 di ogni marted\xec,\ngli honoo e gli hinoo\nsaranno spostati\nnella cartella,\nin sottocartelle nominate,\ndi settimana in settimana,\n<b>Prima Luna<b>,\n<b>Seconda Luna<b>,\neccetera\nfino a <b>Nona Luna<b>,\n\ncondivise con te,\ncon privilegi da Visualizzatore.\n\nAlla fine del Corso,\nti chieder\xf2\ndi realizzare un b>henoo<b>,\ncio\xe8 una composizione\n di un minimo di due\ne di un massimo di nove elementi,\ndove per \u201celemento\u201d\nintendo sia un honoo,\nche un hinoo.\n",B.h,18,null)
